width: 1112px;
height: 88px;
border-bottom: 1px solid #D5DBE1;
`
const LogoBlock = styled.div`
height: 100%;
`
const EndBlock = styled.div`
height: 100%;
`
const Button = styled.button`
width: 108px;
height: 37px;
background-color: #3AD0E6;
border: 1px solid #000000;
font-size: 13px;
font-weight: 600;
border-radius: 40px;
`
const Header = () => {
    return (
        <MainWrapper>
            <LogoBlock>

            </LogoBlock>

            <EndBlock>

                <Button>123</Button>
                <Button>123</Button>
            </EndBlock>

        </MainWrapper>
    )

}
export default Header;
